import useStorage from "../../Hooks/useStorage";
const Progress = ({ file, setFile }) => {
  const { url, Progress } = useStorage(file);
  console.log(url, Progress);
  return (
    <div>
      <p>this is progress</p>
    </div>
  );
};
export default Progress;
